import {  Link} from "react-router-dom";


export default function NavBar() {

  return (
    <>
        <ul>
          <li> <Link to={`/`}>e</Link></li>
          <li> <Link  to={`/home`}> Home</Link></li>
          <li> <Link  to={`/Products`}> Productos</Link></li>
          <li> <Link  to={`/Products`}> Productos</Link></li>
        </ul>
    </> 
    );
}
